int babylonian_to_decimal(char* str){
    int num = 0;
    int base = 60;
    int digit = 0;
    int i = 0;

    
    // count number of digits
    while(str[i] != '\0'){
            if(str[i] == ' '){
                    digit++;
            }
            i++;
    }

    // convert to decimal
    i=0;
    while(str[i] != '\0'){
        
        if(str[i] == 'Y'){
                num += 1 * pow(base, digit);
        }
        else if(str[i] == '<'){
                num += 10 * pow(base, digit);
        }
        else if(str[i] == ' '){
                digit--;
        }
        i++;
    }
    return num;
}

char* decimal_to_babylonian(int num){
    int base = 60;
    int digit = 0;
    int i = 0;
    int temp = num;
    char* str = malloc(1);
    *str = '\0';

    // count number of digits
    while(temp != 0){
            temp /= base;
            digit++;
    }

    // convert to babylonian
    while(num != 0){
        if(num % base == 1){
                str = realloc(str, strlen(str) + 2);
                str[i] = 'Y';
                str[i+1] = '\0';
                i++;
        }
        else if(num % base == 10){
                str = realloc(str, strlen(str) + 2);
                str[i] = '<';
                str[i+1] = '\0';
                i++;
        }
        else{
                str = realloc(str, strlen(str) + 2);
                str[i] = ' ';
                str[i+1] = '\0';
                i++;
        }
        num /= base;
        digit--;
    }
    return str;
}

